In Theatres Nationwide, April 14 “Sweetwater” 

Biopic about the great Nate “Sweetwater” Clifton’s indoctrination as the first black NBA player. Our Great Michael Jordan, who played Nate Clifton on SNL, is the only other figure to spotlight this great achievement on-camera until now! The historic and iconic excellence of Nate will be played by Everett Osborne. The NBA will introduce the film at All-Star Wknd in Salt Lake City during the Legacy Invitational Feb 17th, MJ’s milestone 60th Birthday

Its an honor for all of us involved to be apart of the masterpiece directed by Martin Guigui, produced by Tim Moore, Darren Moorman and our team of outstanding executives.

